import React from 'react';
import { connect } from 'react-redux';

class Zeros extends React.Component {
    constructor(props){
        super(props);
    }
    render(){
        return <div id='Zeros'>
        <h1>Zeros</h1>
            <div>
                <div id='zeroFunction'>
                    <ul>{Object.keys(this.props.fP).map((k) => <li>{`${k} : ${this.props.fP[k]}`}</li>)}</ul>
                </div>
            </div>
        </div>
    }
}

function mapStateToProps(state){
    return {
        fP: state.fP
    }
}
function mapDispatchToProps(dispatch){
    return {
        getZero : (zero) => dispatch({type: 'GETZERO' , zero: zero})
    }
}

export default Zeros;
